import { render } from "@testing-library/react";
// import React from "react";
import React, { Component, useState, useEffect } from "react";
import BeforeAfterSlider from 'react-before-after-slider';
import { Link } from 'react-router-dom';
import {Helmet} from "react-helmet";
//import Testimonial from 'react-testimonial';
//import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import { MDBIcon, MDBContainer, MDBBtn } from 'mdbreact';
import {PricingTable, PricingSlot, PricingDetail} from 'react-pricing-table';
import { Card, CardHeader, CardBody, CardFooter } from 'react-simple-card';
import Slider from "react-slick";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import Typical from 'react-typical';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Navigation} from ".";
const $ = window.$;

var c=1,p=1;

function Home(props)  {



  
$.ajax({
  type: "GET",
  dataType: "json",
  url: 'https://ip-api.io/json?api_key=ceae0f9fbb24a7f45f12d479595194fc',
  success: function(data) {
    console.log(
      'Your ip address is ' + data.ip
        + ' city: ' + data.city
        + ' region: ' + data.region_name
        + ' country: ' + data.country_name
    );
    if(data.country_name=='France'){
      window.location.href = "https://cutoutwiz.com/fr";
    }
    if(data.country_name=='Spain'){
      window.location.href = "https://cutoutwiz.com/es";
    }
    if(data.country_name=='Germany'){
      window.location.href = "https://cutoutwiz.com/de";
    }
    if(data.country_name=='Netherlands'){
      window.location.href = "https://cutoutwiz.com/nl";
    }
    if(data.country_name=='Thailand'){
      window.location.href = "https://cutoutwiz.com/th";
    }
    
  }
});

$(document).ready(function() {

if ($('top:visible').is(":visible")) {

  $("bottom").hide();
} else {
  $("bottom").show();

}
});



$(document).ready(function() {
$('.btn1show').click(function() {
  $('#js-nametag1').show();
  $('#video-size1').show();
  $('#video-size2').hide();
  $('#video-size3').hide();
  $('#video-size4').hide();
  $('#js-nametag2').hide();
  $('#js-nametag3').hide();
  $('#js-nametag4').hide();
});


$('.btn2show').click(function() {
  $('#js-nametag2').show();
  $('#video-size2').show();
  $('#video-size1').hide();
  $('#video-size4').hide();
  $('#video-size3').hide();
  $('#js-nametag1').hide();
  $('#js-nametag3').hide();
  $('#js-nametag4').hide();
});

$('.btn3show').click(function() {
  $('#js-nametag3').show();
  $('#video-size3').show();
  $('#video-size1').hide();
  $('#video-size2').hide();
  $('#video-size4').hide();
  $('#js-nametag2').hide();
  $('#js-nametag1').hide();
  $('#js-nametag4').hide();
});

$('.btn4show').click(function() {
  $('#js-nametag4').show();
  $('#video-size4').show();
  $('#video-size1').hide();
  $('#video-size2').hide();
  $('#video-size3').hide();
  $('#js-nametag2').hide();
  $('#js-nametag1').hide();
  $('#js-nametag3').hide();
});



var quotea = $(".quotea");


if(c==1){
var quoteIndex = -1;

function showNextQuote() {
    ++quoteIndex;c++;
    quotea.eq(quoteIndex % 8)
        .fadeIn(900)
        .delay(6500)
        .fadeOut(900, showNextQuote);
        
}

showNextQuote();
}



});


const settingsimg = {
  dots: false,
  swipe: false,
  pauseOnHover:false,
  infinite: true,
  slidesToShow: 1,
  slidesToScroll: 1,
  autoplay: true,
  breakpoint: 0,
  speed: 4000,
  autoplaySpeed: 8000,

  responsive: [{
    breakpoint: 600,
    settings: {
      slidesToShow: 1,
      slidesToScroll: 1,
      initialSlide: 1
    }
  }]
};
 

  const settings = {   
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    speed: 1000,
    autoplaySpeed: 4000,
    cssEase: "linear",

    responsive: [{
      breakpoint: 600,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
        initialSlide: 1
      }
    }]
  };




  window.addEventListener('scroll',()=>{
    let content= document.querySelector('.fade-in-text');
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if(contentPosition < screenPosition){
      content.classList.add('active');
    }
    else{
      content.classList.remove('active');
    }
  })

  window.addEventListener('scroll',()=>{
    let content= document.querySelector('.fade-in-text40k');
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if(contentPosition < screenPosition){
      content.classList.add('active');
    }
    else{
      content.classList.remove('active');
    }
  })

  window.addEventListener('scroll',()=>{
    let content= document.querySelector('.fade-in-text92k');
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if(contentPosition < screenPosition){
      content.classList.add('active');
    }
    else{
      content.classList.remove('active');
    }
  })


  window.addEventListener('scroll',()=>{
    let content= document.querySelector('.fade-in-text54k');
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if(contentPosition < screenPosition){
      content.classList.add('active');
    }
    else{
      content.classList.remove('active');
    }
  });


  


  return (
    
    <div className="home">
         <Router >
       <Navigation /> 
      </Router>
      <Helmet>
                <title>CutOutWiz : Image and Video Post Production</title>
                <meta  name="description" keywords="Product photo edinting company" content="CutOutWiz is one of the leading image and video editing company for businesses all over the world. As the world moves towards a virtual business base, product photo editing has been a very important part for any E-commerce business "  
                /> 
     </Helmet>



{/*Banner section */}



     
{/* Banner card section */}



{/* Count Record */}





{/* Image editing service */}



{/* Video editing service */}




{/* Apps with testimonial slider */}



{/* Plan  */}




{/* Place an order */}

<div id="place-order" style={{backgroundColor:"#062220",backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        width: '98.7vw',
        height: '100vh'}}><div id="how-it-works"></div>
       
      <div>
        <br/>
          <p style={{color:"white",fontSize:"38px",textAlign:"center",fontWeight:"700",marginTop:"2%",fontFamily:"Branch"}}>How to Place an Order</p>
             <p style={{color:"#ff9900",textAlign:"center",marginTop:"-1%"}}>Just follow these simple steps, and we will take it from there</p>
          </div>

          <div class="container">
            <div class="row">
              <div class="col-md-3"></div>
              <div class="col-md-6">
              <video height="100%" width="100%"style={{marginTop:"2%"}}  controls autoplay> <source src="assets/images/Key-features-Video.mp4"></source></video>
              </div>
              <div class="col-md-3"></div>
            </div>
          </div>

        
          <div class="row" style={{paddingLeft:"2%",paddingRight:"2%",marginTop:"5%"}}>
            <div class="col-6 col-md">
          <div class="card" style={{width: "100%",borderRadius:"10px",backgroundColor:"#01302b",color:"white",boxShadow:"1px 2px 3px 4px rgba(12,12,12,0.2)",border:"black"}}>
          <img src="assets/images/et.png"  width="30%" height="30%" alt="Image icon"/><br/>
              <div class="card-body">
                <h4 class="card-title">Step 1:</h4>
                <hr style={{width:"32%",border:"1px solid #ff9900",backgroundColor:"#ff9900",opacity:"1",marginTop:"-1%"}}></hr>
                <p class="card-text"id="btmspace" style={{fontWeight:"500",marginBottom:"11.2%",fontSize:"13px"}}>Sign In</p>
              </div>
              
              </div>
          </div>
          
          <div class="col-6 col-md">
          <div class="card" style={{width: "100%",borderRadius:"10px",backgroundColor:"#01302b",color:"white",boxShadow:"1px 2px 3px 4px rgba(12,12,12,0.2)",border:"black"}}>
              
              <img src="assets/images/subscribe-09.png"  width="30%" height="30%" alt="Image icon"/><br/>
              <div class="card-body">
                <h4 class="card-title">Step 2:</h4>
                <hr style={{width:"32%",border:"1px solid #ff9900",backgroundColor:"#ff9900",opacity:"1",marginTop:"-1%"}}></hr>
                <p class="card-text"style={{fontWeight:"500",fontSize:"13px"}}>Choose your<br/>preferred subscription plan</p>
              </div>
              </div>
          </div>

          <div class="col-6 col-md">
          <div class="card" style={{width: "100%",borderRadius:"10px",backgroundColor:"#01302b",color:"white",boxShadow:"1px 2px 3px 4px rgba(12,12,12,0.2)",border:"black"}}>
          <img src="assets/images/order-09.png"  width="30%" height="30%" alt="Image icon"/><br/>

              <div class="card-body">
                <h4 class="card-title">Step 3:</h4>
                <hr style={{width:"32%",border:"1px solid #ff9900",backgroundColor:"#ff9900",opacity:"1",marginTop:"-1%"}}></hr>
                <p class="card-text"style={{fontWeight:"500",fontSize:"13px"}}>Go to your<br/>account to place an order</p>
              </div>
              </div>
          </div>

          <div class="col-6 col-md">
          <div class="card" style={{width: "100%",borderRadius:"10px",backgroundColor:"#01302b",color:"white",boxShadow:"1px 2px 3px 4px rgba(12,12,12,0.2)",border:"black"}}>
          <img src="assets/images/upload-09.png"  width="30%" height="30%" alt="Image icon"/><br/>
              <div class="card-body">
                <h4 class="card-title">Step 4:</h4>
                <hr style={{width:"32%",border:"1px solid #ff9900",backgroundColor:"#ff9900",opacity:"1",marginTop:"-1%"}}></hr>
                <p class="card-text"style={{fontWeight:"500",fontSize:"13px"}}>Upload the<br/>images you want us to edit</p>
              </div>
              </div>
